void get_op_window(float temp,float *net,float *min,float *max,float *window) {
    if (temp>vdd_V) temp=vdd_V;
    if (temp<0) temp=0;
    if (*window<temp) *window=temp;
    if (*min>temp) *min=temp;
    if (*max<temp) *max=temp;
}
void limit_voltage(float *var,float min, float max) {
    if (*var<min) {
        viable=0;
        *var=min;
    }	
    if (*var>max) {
        *var=max;
        viable=0;
    }	
}
void average_voltage(float *var1,float *var2) {
    float mean=0.5*(*var1+*var2);
    *var1=mean;
    *var2=mean;
}    
void limit_conductance(float *var,char *varname,float min) {
    if (*var<min) {
        //        printf("Warning: %s is in cutoff\n",varname);
        viable=0;
        *var=min;
    }
}
